import React from 'react'
import './Footer.css';

const Footer = () => {
    return (
        <footer className="foot">
            <img src="public/icon1.png" alt="ironhack logo" />
            <img src="/menu-top.svg" alt="ironhack logo" />
        </footer>
    )
}

export default Footer
